import "./detailContent.css";
const DetailContent = () => {
  return (
    <div className="detail">
      <div className="detail__someInfo d-flex">
        <div className="detail__someInfo--news"></div>
        <div className="detail__someInfo--button"></div>
      </div>
    </div>
  );
};

export default DetailContent;
